import React from 'react';
import './style.css';
import pif_paf from '../../assets/ha'

const Event = () => {
    const events = [
      "Hackathon em parceria com a Pif Paf Alimentos (Certificado)"
    ];

    return (
      <section id='eventos'>
        <h2>Eventos</h2>
        <ul>
          {events.map((event, index) => (
            <li key={index}>{event}</li>
          ))}
        </ul>
      </section>
    );
  }

  export default Event;
